import { useEffect, useState } from "react";
import { useNavigate, useSearchParams } from "react-router-dom";
import { v4 as uuidv4 } from "uuid";
import mockAPI from "../api/mockapi";
import converter from "../api/converter";
import Table from "./Table";
import Map from "./Map";
import styles from "./Results.module.css";
import axios from "axios";

const iso3166 = require("iso-3166-1");

function Results({ currency, updateFavs }) {
  const [holidayData, setHolidayData] = useState([]);
  const [convertedCurrency, setConvertedCurrency] = useState("USD");
  const [nativeCurrency, setNativeCurrency] = useState(
    "(This country does not have native currency)"
  );
  const [isLoading, setIsLoading] = useState(false);
  const [buttonText, setButtonText] = useState("Add to Favorites");
  const navigate = useNavigate();

  const [searchParams] = useSearchParams();
  const [searchedCountry] = useState(searchParams.get("country"));
  const [searchedYear] = useState(searchParams.get("year"));
  const [startDate, setStartDate] = useState(`${searchedYear}-01-01`);
  const [endDate, setEndDate] = useState(`${searchedYear}-12-31`);
  const countryData = iso3166.whereAlpha2(searchedCountry);

  const API_KEYS_ARRAY = process.env.REACT_APP_API_KEY.split(" ");
  const COUNTRY_API_KEY = API_KEYS_ARRAY[0];
  const CONVERTER_API_KEY = API_KEYS_ARRAY[1];

  const filteredData = holidayData.filter(
    (data) => data.date.iso > startDate && data.date.iso < endDate
  );
//api.api-ninjas.com/v1/convertcurrency?X-Api-Key=j77bYRSw74MdxLlsI2dSWA%3D%3D8QdM4MzTa0ei9tQG&want=USD&have=SGD&amount=1
https: useEffect(() => {
  const apiGet = async () => {
    setIsLoading(true);
    try {
      const response = await mockAPI.get(
        `/holidays?&api_key=${COUNTRY_API_KEY}&country=${searchedCountry}&year=${searchedYear}`
      );
      setHolidayData(response.data.response.holidays);
      setIsLoading(false);
    } catch (error) {
      console.log(error.message);
    }
  };

  const fetchNativeCurrency = async () => {
    setIsLoading(true);
    try {
      const response = await axios.get(
        `https://api.api-ninjas.com/v1/country?X-Api-Key=j77bYRSw74MdxLlsI2dSWA==8QdM4MzTa0ei9tQG&name=${countryData.country}`
      );
      setNativeCurrency(response.data);
      console.log(response);
      setIsLoading(false);
    } catch (error) {
      console.error("Error fetching currency:", error);
    }
  };

  const fetchCurrency = async () => {
    setIsLoading(true);
    try {
      const response = await converter.get("/convertcurrency", {
        params: {
          "X-Api-Key": CONVERTER_API_KEY,
          want: "USD",
          have: `${currency}`,
          amount: 1,
        },
      });
      setConvertedCurrency(response.data.new_amount);
      setIsLoading(false);
    } catch (error) {
      console.error("Error fetching currency:", error);
    }
  };

  apiGet();
  fetchNativeCurrency();
  fetchCurrency();
  // eslint-disable-next-line react-hooks/exhaustive-deps
}, [searchedCountry, searchedYear]);

  const handleAdd = () => {
    const newFav = {
      id: uuidv4(),
      country: countryData.country,
      start: startDate,
      end: endDate,
      notes: "",
    };
    updateFavs(newFav);
    setButtonText("Added!");
    setTimeout(() => {
      setButtonText("Add to Favorites");
    }, 500);
  };

  const handleStart = (e) => {
    setStartDate(e.target.value);
  };

  const handleEnd = (e) => {
    setEndDate(e.target.value);
  };

  return (
    <div className={styles.results}>
      <button className={styles.back} onClick={() => navigate("/search")}>
        {`Â« Back to Search`}
      </button>
      <p className={styles.title}>
        {`Travel to ${countryData.country} in ${searchedYear}`}
        <button className={styles.add} onClick={handleAdd}>
          {buttonText}
        </button>
      </p>
      <h1>{`${countryData.country} Holidays in ${searchedYear}`}</h1>
      <label>From: </label>
      <input
        type="date"
        value={startDate}
        min={`${searchedYear}-01-01`}
        max={`${searchedYear}-12-30`}
        onChange={handleStart}
      />
      <label> To: </label>
      <input
        type="date"
        value={endDate}
        min={`${searchedYear}-01-02`}
        max={`${searchedYear}-12-31`}
        onChange={handleEnd}
      />
      <br />
      <h4>{`1 ${currency} = $ ${convertedCurrency} ${nativeCurrency}`}</h4>
      <div>
        {isLoading ? <progress /> : <Table filteredData={filteredData} />}
      </div>
      <Map searchedCountry={countryData.country} />
    </div>
  );
}
export default Results;
